import classesMain from "./Main.module.css";
import Divider from "./Divider";
import classesContact from "./Contact.module.css";
import InputWithLabel from "./InputWithLabel";

const Contact = () => {
  return (
    <>
      <div className={classesContact.contactContainer}>
        <h1 className={classesMain.subTitle}>CONTACT ME</h1>
        <Divider color="black" />
        <div>
          <InputWithLabel label="Full Name" placeholder="John Doe" />
        </div>
      </div>
    </>
  );
};

export default Contact;
